import React from 'react';
import './App.css';
import './animations.scss';
import Header from './Components/Header';
import Tags from './Components/Tags';
import Cards from './Components/Cards';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <Tags />
      <Cards />
    </div>
  );
}

export default App;
